var mkdirp = require("mkdirp")
  , fs = require("browserify-fs")
  , plugins = module.exports = {files:{}};

plugins.import = function(cb){
  Object.keys(plugins.files).forEach(function(path){
    var dir = path.split("/")
    dir.pop()
    dir = "node_modules/"  + dir.join("/");
    console.log("mkdirp", dir)
    mkdirp(dir, {fs: fs},function(err){
      if (err)
        return cb(err)

      fs.writeFile("node_modules/"+ path, plugins.files[path],function(err){
        if (err)
          return cb(err)

      })
    })
  })
}
